import React from 'react';
import {Link} from "react-router-dom";
import { useMatches } from "react-router-dom";

const Header = () => {

    const matches = useMatches("/Login");
   

    return (
        <header className="header">
            <Link to="/Login">
                <img src="/Style/logo2.jpg" alt="logo" className="logo"/>
            </Link>


            <div className="">
                {loginMatch.isExact ? (
                    <Link to={`${match.url}/Login`}>Sign in</Link>
                ) : (
                    <Link to={`${match.url}/SignUp`}>Sign Up</Link>
                )}
            </div>
        </header>
    );
};

export default Header;
